import React from 'react';
import { BrowserRouter as Router, Routes,Route } from 'react-router-dom';
import Map from './Map';
import CountryInfo from './CountryInfo';

function App() {
  return (
    <Router>
      <Routes>
      <Route path="/" exact component={Map} />
      <Route path="/country/:name" component={CountryInfo} />
      </Routes>
    </Router>
  );
}

export default App;
